#define _CRT_SECURE_NO_WARNINGS 1
#include<iostream>
#include<stdlib.h>
#include<string>
using namespace std;
class Solution {
public:
	bool canConstruct(string ransomNote, string magazine)
	{
		int buf[256] = { 0 };
		for (size_t i = 0; i < magazine.size(); i++)
			buf[magazine[i]]++;
		for (size_t i = 0; i < ransomNote.size(); i++)
		{
			if (buf[ransomNote[i]] == 0)
				return false;
			buf[ransomNote[i]]--;
		}
		return true;
	}
};
int main()
{
	string s1 = "";
	string s2 = "";
	Solution s;
	cout<<s.canConstruct(s1, s2);
	system("pause");
	return 0;

}